// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./TestToken.sol";
import "hardhat/console.sol";

contract TestMarket {
    struct Order {
        uint128 size;
        uint40 owner;
        uint40 fillBefore;
        uint40 fillAfter;
    }
    
    struct PriceLevel {
        uint128 size;
        uint40 fillNext;
        uint40 latest;
    }

    uint256 private constant feeDenomination = 1e6;
    uint256 private constant makerRebate = 50;
    uint256 private constant fee = 300;
    uint256 private constant scaleFactor = 1e21;

    TestToken public immutable quoteAsset;
    TestToken public immutable baseAsset;

    uint128 public immutable minSize = 10e6;
    uint80 public immutable maxPrice = 10e15;
    uint80 public lowestAsk = type(uint80).max;
    uint80 public highestBid = 0;

    mapping(uint256 => PriceLevel) public priceLevels;
    mapping(uint256 => mapping(uint256 => Order)) public orders;

    uint40 public latestUserId;
    mapping(address => uint256) public addressToUserId;
    mapping(uint256 => address) public userIdToAddress;

    constructor(address _quoteAsset, address _baseAsset) {
        quoteAsset = TestToken(_quoteAsset);
        baseAsset = TestToken(_baseAsset);
    }

    function registerUser(address caller) external returns (uint256 id) {
        id = ++latestUserId;
        addressToUserId[caller] = id;
        userIdToAddress[id] = caller;
    }

    /**
     * @notice Place a limit order
     * @param isBuy Whether the order is a buy order
     * @param price The price of the order (scaled price)
     * @param size The size of the order (unscaled units, INCLUDING DECIMALS)
     * @param userId The user ID of the order (requires pre-registration)
     * @return id The ID of the order
     */
    function limitOrder(
        bool isBuy,
        uint80 price,
        uint256 size,
        uint40 userId
    ) external returns (uint40 id) {
        require(userId != 0 && price > 0 && price < maxPrice);
        uint80 _highestBid = highestBid;
        uint80 _lowestAsk = lowestAsk;

        if (isBuy) {
          require(price < _lowestAsk && size >= minSize);
          if (price > _highestBid) highestBid = price;
          IERC20(quoteAsset).transferFrom(msg.sender, address(this), size);
          size *= scaleFactor;
        } else {
          size *= price;
          require(price > _highestBid && size / scaleFactor >= minSize);
          if (price < _lowestAsk) lowestAsk = price;
          IERC20(baseAsset).transferFrom(msg.sender, address(this), size / price);
        }
        PriceLevel memory _priceLevel = priceLevels[price];
        if (_priceLevel.fillNext == 0) {
            _priceLevel.fillNext = 1;
        }
        require(size <= type(uint128).max);
        _priceLevel.size = _priceLevel.size + uint128(size);
        ++_priceLevel.latest;
        priceLevels[price] = _priceLevel;
        id = _priceLevel.latest;
        uint40 fillBefore = orders[price][id].fillBefore;
        fillBefore = fillBefore == 0 ? uint40(id - 1) : fillBefore;
        orders[price][id] = Order(uint128(size), userId, fillBefore, uint40(id + 1));
        return id;
    }

    /**
     * @notice Fill a market order
     * @param orderType The type of order (only exact-input buys for now)
     * @param size The amount of quote token to spend (unscaled units, INCLUDING DECIMALS)
     * @return amountIn The amount of quote token spent
     * @return amountOut The amount of base token received
     * @return rebate The amount of maker rebate paid out
     */
    function marketOrder(
        uint8  orderType,
        uint128 size
    ) external returns (
        uint256 amountIn,
        uint256 amountOut,
        uint256 rebate,
        uint256 feeTaken
    ) {
        bool isBuy = (orderType & 0xF) == 0;
        bool isExactInput = ((orderType >> 4) & 0xF) == 0;
        if (!(isBuy && isExactInput)) return (0, 0, 0, 0); 
        IERC20(quoteAsset).transferFrom(msg.sender, address(this), size);
        amountIn = size;
        uint256 internalRemain = uint256(size) * scaleFactor;
        feeTaken = (internalRemain * fee) / feeDenomination / scaleFactor;
        internalRemain = internalRemain * (feeDenomination - fee) / feeDenomination;
        uint80 p = lowestAsk;
        require(p != 0 && p != type(uint80).max);

        while (internalRemain > 0 && p < maxPrice) {
            PriceLevel storage level = priceLevels[p];
            if (level.size == 0) { ++p; continue; }
            uint40 id = level.fillNext;
            while (id != 0 && internalRemain > 0) {
                Order storage o = orders[p][id];
                uint256 need = uint256(o.size) * feeDenomination / (feeDenomination - makerRebate);
                if (need > internalRemain) {
                    uint256 baseInternal = internalRemain * (feeDenomination - makerRebate) / feeDenomination;
                    o.size -= uint128(baseInternal);
                    level.size -= uint128(baseInternal);
                    rebate += internalRemain * makerRebate / feeDenomination / scaleFactor;
                    amountOut += baseInternal / p;
                    address maker = userIdToAddress[o.owner];
                    IERC20(quoteAsset).transfer(maker, internalRemain / scaleFactor);
                    IERC20(baseAsset).transfer(msg.sender, baseInternal / p);
                    internalRemain = 0;
                } else {
                    internalRemain -= need;
                    level.size -= o.size;
                    rebate += need * makerRebate / feeDenomination / scaleFactor;
                    amountOut += o.size / p;
                    uint40 nextId = o.fillAfter;
                    level.fillNext = nextId;
                    delete orders[p][id];
                    id = nextId;
                    address maker = userIdToAddress[o.owner];
                    IERC20(quoteAsset).transfer(maker, need / scaleFactor);
                    IERC20(baseAsset).transfer(msg.sender, o.size / p);
                }
            }
            if (level.size == 0) ++p;
        }
        if (priceLevels[lowestAsk].size == 0) {
            uint80 newLowest = lowestAsk + 1;
            while (newLowest < maxPrice && priceLevels[newLowest].size == 0) ++newLowest;
            lowestAsk = (newLowest < maxPrice) ? newLowest : type(uint80).max;
        }
        require(internalRemain == 0);
    }
}

